  true,\n\t\"url\": null,\n\t\"notes\": \"Used to store information on Federal employees
  in the Senior Executive Service (SES) and appointed employees in the Schedule C
  System. Every four years, just after the Presidential election, the United States
  Government Policy and Supporting Positions, commonly known as the Plum Book, is
  published, alternately, by the Senate and the House. The Plum Book is used to identify
  presidentially appointed positions within the Federal Government. The data in the
  Plum Book comes from the ESCS but may be slightly modified by the Government Printing
  Office before publication based on additional information they have.\",\n\t\"license_title\":
